export default function Card({ card, onCardClick }) {
  return (
    <article className="cards__element">
      <img className="cards__photo" 
        src={card.link} 
        alt={`Изображение ${card.name}`} 
        onClick={() => onCardClick({link: card.link})}
      />
      <button className="cards__button-delete" type="button" />
      <div className="cards__name">
        <h2 className="cards__title">{card.name}</h2>
        <div className="cards__like-elements">
          <button className="cards__button-like" type="button" />
          <span className="cards__number-likes" />
        </div>
      </div>
    </article>
  )
}
